import React from 'react';
import { IonContent, IonItem, IonAvatar, IonFab, IonFabButton, IonFabList, IonIcon, IonLabel, IonButton, IonHeader, IonPage, IonTitle, IonToolbar, IonInfiniteScroll } from '@ionic/react';
import { add } from 'ionicons/icons';
import './Tab3.css';
import Club from '../components/Club';
import { RouteComponentProps } from 'react-router';

import john from '../images/john.jpg'
import ice from '../images/rsz_ice_cream.jpg'

let test_club = new Club("Cal Poly Ice Cream Club", 1, "A club for people who like Ice Cream", ice, john, [], "Cal Poly SLO", [], undefined, [], [])
let test_club2 = new Club("John Club", 1, "A club for people who like John", john, john, [], "Cal Poly SLO", [], undefined, [], [])

const ClubView = (props : {club: Club}) => {
  return(
    <IonItem lines="none" button onClick={() => { }}>
      <IonAvatar slot="start">
        <img src={props.club.profileImage} />
      </IonAvatar>
      <IonLabel className="club-item">
        {props.club.name}
      </IonLabel>
    </IonItem>
  )
}

const Tab3: React.FC<RouteComponentProps> = (props) => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>My Clubs</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonInfiniteScroll>
          <IonButton color="primary" size="large" expand="block" onClick={() => props.history.push('clubRegistration')}>Register Your Club!</IonButton>
          <ClubView club={test_club}/>
          <ClubView club={test_club2}/>
          
          <IonFab horizontal="start" vertical="center" slot="fixed">
            <IonFabButton color="danger">
              <IonIcon icon={add}></IonIcon>
            </IonFabButton>
          </IonFab>


        </IonInfiniteScroll>
      </IonContent>
    </IonPage>
  );
};

export default Tab3;
